insert into tds_coremessageobject values ('Default.aspx','ServerSide',11030,'Student','StaticContent.Label.PTLoginText','<p>To log in with your student account (using Name / SSID):</p><ul><li>Uncheck the "Guest User" checkbox (both fields will become blank)</li><li>Enter your First Name and SSID in the fields above.</li></ul><p>To log in as a Guest (anonymous user):</p><ul><li>Mark the "Guest User" checkbox (both fields will automatically display Guest)</li><li>Click [Sign In] to login to the Training Test as a guest user.</li></ul><p><em>Guest Session?</em><br />In a Guest Session, you do not need Test Administrator approval and can take a Training Test using your own settings. To take a Training Test in a session with a Test Administrator, uncheck the â€œGuest Sessionâ€ checkbox and enter the Session ID in the field before clicking [Sign In].</p>',null,2499,null,'2012-05-03 19:17:36.590',null,NULL);
