insert into tds_coremessageobject values ('Default.aspx','ClientSide',10524,'Proctor','Label.IntroText','<p><strong>Starting the Session:</strong></p>            <ul>              <li>Select the assessment(s) that need to be included in the session, then click the [Start Session] button.</li>              <li>Provide the Session ID to your students so that they can log in.</li>            </ul>            <p><strong>Approving Students:</strong></p>            <ul>              <li>Click the [Approvals (#)] button. The Approvals and Student Test Settings window will appear.</li>              <li>Click [See/Edit Details] for a student to view his or her accommodations and test settings and make any necessary changes (e.g., color background choice).</li>              <li>Click the [Approve] button for each student to allow entry into the session. </li>              <li>Click [Approve All Students] if all their settings are accurate and they can all enter the session. </li>              <li>To deny a student, click [Deny] and enter a brief reason (e.g., student selected the wrong assessment). </li>            </ul>            <p><em>Note: Once students are approved, their settings for the current opportunity cannot be changed. </em></p>            <p><strong>Student Lookup:</strong></p>            <p>You can use this feature to look up student information if a student is having difficulty logging in. </p>            <ul>              <li>Click the [Student Lookup] button in the top row.</li>              <li>Use the [Quick Search] tab to find a student using his or her SSID number. Partial SSIDs are not allowed.</li>              <li>Use the [Advanced Search] tab to find a student by district, school, and first or last name. Partial names are allowed. (e.g., entering "Fi" into the last name field will start a search for all students in the school whose last name begins with Fi). </li>            </ul>            <p><strong>Monitoring Student Progress:</strong></p>            <p>Students that appear in the table below have entered this session. The page automatically refreshes every minute. When the page refreshes, the studentsâ€™ statuses in the table below will update. The current status plus (#/#) will indicate how many test items the student has answered out of the total number of test items in the assessment. </p>            <p><strong>Stopping the Test Session</strong></p>            <ul>              <li>When all students have completed testing or it is time for the session to end, click [Stop Session]. </li>              <li>This will end the session, pause all your students'' assessments and then log them out of the online testing system. </li>            </ul>',null,3198,null,'2012-09-06 16:40:46.343',null,NULL);
